import React, { useEffect } from 'react';
import './styles/globals.css';
import './styles/tree.css';
import './BST/js_binary_search_tree.css';
import './AVL/js_avl_tree.css';
import './RB/rb.css';
import RBTreeUI from './RB/rb-ui';
import RBTREE from './RB/rb';


const RB = () => {
    useEffect(() => {
      const main = () => {
        const rbTree =new RBTREE();
        const rbUI = new RBTreeUI(rbTree);
        rbUI.init();
        rbUI.render();
        window.rbTree = rbTree;
      };

      main();
    }, []);


    return (
      <div>
        {/* Add JSX for rendering components if needed */}
      </div>
    );
  };
export default RB;
